    const navigate = useNavigate()

    const isLoggedin = userData.isAutenticated
    useEffect(() => {
        if(!isLoggedin) {
            //Volver a la pagina de index
            navigate('/')
        }
    }, [isLoggedin, navigate])

    return (
        <div>
            
        </div>
    )
}
